import './App.css';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import ImageShow from './components/ImageShow';

import image1 from "./components/image-show/print1.jpg";
import image2 from "./components/image-show/print2.jpg";

function App() {
  return (
    <div className="App">
    <Navbar/>
    <ImageShow 
      bgImage={`url(${changeImageShow(imageNumber)})`}
    />
    <Footer/>
    </div>
  );
}

export default App;
